export default function Login({ onLogin }) {
  return (
    <div className="h-screen flex items-center justify-center bg-orange-50">
      <div className="bg-white p-10 rounded-xl shadow-lg w-96 text-center">
        <h2 className="text-2xl font-bold text-orange-600 mb-6">
          FoodDash Login
        </h2>

        <button onClick={() => onLogin("ADMIN")}
          className="w-full mb-3 bg-orange-500 text-white py-2 rounded">
          Login as Admin
        </button>

        <button onClick={() => onLogin("MANAGER")}
          className="w-full mb-3 bg-orange-400 text-white py-2 rounded">
          Login as Manager
        </button>

        <button onClick={() => onLogin("MEMBER")}
          className="w-full bg-orange-300 text-white py-2 rounded">
          Login as Member
        </button>
      </div>
    </div>
  );
}
